import React from 'react';

const Show = (props) => {

  return(
    <div>

      { props.type && <p>Job Type: { this.props.type }</p> }
      { this.props.url && <p>URL: { this.props.url }</p> }
      { this.props.created_at && <p>Created At: { this.props.created_at }</p> }
      { this.props.company && <p>Cmpany Name: { this.props.company }</p> }
      { this.props.company_url && <p>Company URL: { this.props.company_url }</p> }
      { this.props.location && <p>Job Location: { this.props.location }</p> }
      { this.props.job_title && <p>Job Title: { this.props.job_title }</p> }
      { this.props.description && <p>Job Description: { this.props.description }</p> }
      { this.props.company_logo && <p>Company Logo: { this.props.company_logo }</p> }
      { this.props.how_to_apply && <p>How to apply: { this.props.how_to_apply }</p> }
      { this.props.error && <p>{ this.props.error }</p> }

    </div>
  );

}


export default Show;
